    const serial_id = params.id;
    var shops = []
    useEffect(() => {
        if (isLoading) {
            getSerial({ serial_id })
                .then((result) => {
                    console.log(result);
                })
                .catch((error) => console.log(error))
            getShops()
                .then((result) => {
                    console.log(result)
